import React from 'react';
import { StyleSheet, ImageBackground, View, TouchableOpacity, Text} from 'react-native';

const HomeScreen = ({ navigation }) => {
  return (
		<ImageBackground source={require('./../../assets/home.jpg')} style={styles.backgroundImage}>
			<View style={styles.fixToText}>

        <Text style={styles.defaultMessage}>
          Welcome to HotelHub! Start by signing into your account or creating a new one.
        </Text>

        <TouchableOpacity 
          //onPress={() => navigation.navigate('Signup')}
          style={styles.button}>
          <Text style={styles.inputText}>
            Sign up
          </Text>
        </TouchableOpacity>

				<TouchableOpacity 
          onPress={() => navigation.navigate('Login')}
          style={styles.button}>
          <Text style={styles.inputText}>
            Log in
          </Text>
        </TouchableOpacity>
    	</View>
		</ImageBackground>
	);
}

const styles = StyleSheet.create({
	backgroundImage: {
		flex: 1,
    alignItems: 'center',
    justifyContent: 'center',
	},
	fixToText: {
    justifyContent: 'space-between',
    alignItems: 'center',
  },
  inputText: {
    color:"white"
  },
  button:{
    width:"80%",
    backgroundColor:"#fb5b5a",
    borderRadius:25,
    height:50,
    width: 300,
    alignItems:"center",
    justifyContent:"center",
    marginBottom:10
  },
});

export default HomeScreen;
